column8:
こちらの商品は発送まで2～3営業日(土日祝日は除きます)いただいております。<br /><br>リバティプリントのタナローン生地を使ったソーイングバスケットです。<br /><br />
ソーイングボックスとしては裁ちばさみが入るのにすっきりとしたコンパクトサイズが魅力。<br />
リビングではテレビやビデオのリモコンやビタミン剤などを入れて、お部屋の片隅に置いているだけで、インテリアのアクセントにもなります。<br /><br />
サイズ：約28.5×17×17cm<br />
素材：裏表布 綿100％<br /><br /><!-- ここから -->
